  "geo" : { },
  "id_str" : "392353370532364288",
  "in_reply_to_user_id" : 1484341,
  "text" : "I'm not talking about Santa or the Easter Bunny or whatever, by the way. I mean little lies about mundane things in the world.",
  "id" : 392353370532364288,
  "in_reply_to_status_id" : 392353042382598144,
  "created_at" : "2013-10-21 18:15:07 +0000",
