  "geo" : { },
  "id_str" : "392353042382598144",
  "in_reply_to_user_id" : 1484341,
  "text" : "Religion and politics are polluted with the requirement that leaders deign to be omniscient - children are told lies because it's funny.",
  "id" : 392353042382598144,
  "in_reply_to_status_id" : 392352750178013184,
  "created_at" : "2013-10-21 18:13:49 +0000",
